갤럭시s7 엣지 실버 32기가 처분해요  
	                            직접거래
	                         갤럭시s7엣지 32기가 실버팔아요엘지 유플 기긱구요유심기변만 가능합니다3사 호환가능하구요단품입니다액정보호 필름사용해서 액정에 기스없어요뒤에도기스없습니다 작동은 완전잘되요 50만원 여기는충북이구요0&lt;form name id method&gt;&lt;form&gt;&lt;input name id type &gt; &lt;form name method target&gt;&lt;form&gt;

루나워치 화이트+청바지 스트랩+풀박+공기계정상해지  5 5만원에 팝니다 
	                            직접거래
	                         루나워치 화이트+청바지 스트랩설현 스페셜 에디션 +풀박+공기계정상해지  5 5만원에 팝니다 잠깐 실사용을 했던지라 미개봉이나 가개통처럼 새것같지는 않습니다 직장인이라 서울 홍대로 직거래 하러 와주실 수 있으신 분만 거래합니다 모르는 전화는 받지 않으니 로 문자만 주세요 중고 기계의 특성상 환불이나 매매 후 이의 제기를 받지 않으니 오셔서 기기 살펴보시고 직접 테스트 후 구입하시길 바랍니다 이 게시물에 판매완료 처리 없으면 아직 거래 안된거예요  언제든 연락주세요   &nbsp;
